import React from 'react'
import axios from "axios"
import {
    Card, ListGroup, ListGroupItem, Row, Col
  } from 'react-bootstrap';


function Welcome(props) {
    return <h1>Hello, {props.name}</h1>;
  }

  function MovieCard() {
    return (
      <Row>
        <Col>
            <div className="movieCard">
                <h3 className="movieData">Title: </h3>
                <h4 className="movieData">Rating: </h4>
            </div>
        </Col>
            {/* <Welcome name="Sara" />
            <Welcome name="Cahal" />
            <Welcome name="Edite" /> */}
      </Row>
    );
  }

  export default MovieCard;
